package com.superwall.sdk.paywall.archive

import android.util.Base64
import io.mockk.mockk
import org.junit.Test
import kotlin.io.encoding.ExperimentalEncodingApi

class ManifestDownloaderTest {
    val downloader = ManifestDownloader(mockk(), mockk())

    @OptIn(ExperimentalEncodingApi::class)
    @Test
    fun extractAbsoluteUrls() {
        val content =
            kotlin.io.encoding.Base64
                .decode(testDoc)
                .toString(Charsets.UTF_8)
        val abs = downloader.discoverAbsoluteResources(content)
        val rel = downloader.discoverRelativeResources(content)
        println(abs.size)
        assert(abs.size > 1)
        abs.forEach {
            println("Abs resource ${it.key}")
        }

        println(rel.size)
        rel.forEach {
            println("Rel resource ${it.key}")
        }
        assert(rel.size > 1)
    }
}

val testDoc =
    """
    
    """.trimIndent()
